start_screen_init: 
	#initalize values to display the start screen
	li $t0, BASE_ADDRESS
	la $t1, start_screen
	li $t2, 0
	li $t3, 4096
	j draw_go_loop
	#16384


init:
    	#initalize registers   
    	li $s0, BASE_ADDRESS         
    	li $s1, BASE_ADDRESS
    	li $t7, BASE_ADDRESS
    	addi $t0, $zero 0 #initialize t0 to 0
    	li $s1, START_INDEX_OGRE #s1 is the initial address of the ogre start index
    	li $s2, OGRE_LEFT_FOOT_INDEX #s2 is the initial address of the ogre's left foot
    	li $s3, OGRE_RIGHT_FOOT_INDEX #s3 is the intital addres of the ogre's right foot
    	addi $t7, $t7, 16384
    	li $k0, 2 #counter for jumps
    
fill_sky:
   	#fill in the background
   	li $t1, BACKGROUND_COLOR  	
   	bgt $s0,$t7, draw_ogre
   	sw $t1,0($s0)
   	add $s0,$s0,4
   	j fill_sky

draw_ogre:
	jal clear_ogre
 	li $s1, START_INDEX_OGRE #s1 is the initial address of the ogre start index
        li $k1, 3 #reset lives
	#Loading colors in registers
	li $t2, GREEN      
 	li $t3, LIGHT_BROWN
 	li $t4, DARK_BROWN
 	li $t5, BROWN
 	li $t6, SHOES
 	li $t8, GOLD
 	add $t0, $gp, $s1
	sw $t2, 24($t0)
	sw $t2, 28($t0)
	sw $t2, 44($t0)
	addi $t0, $t0, 256 #GO DOWN ONE ROW
	sw $t2, 24($t0)
	sw $t2, 28($t0)
	sw $t2, 44($t0)
	addi $t0, $t0, 256 #GO DOWN ONE ROW
	sw $t3, 12($t0)
