reset_jump:
	li $k0, 2 #we want to reset the jumps every time you land on platform

mainLoop:
    	#checks for keyboard input, redraws 
    	lw $t5, 0xffff0000 
    	beq $t5, 1, do_action #if a key is pressed, go check which action to do
    
    	#redraw all of the platforms in every iteration, so the ogre can go "through" them
    	li $s0, PLATFORM_1
    	add $t0, $gp, $s0
    	li $t2, platformC1
    	li $t9, platformC2
    	li $t3, 20
    	jal plat_loop
    	li $s0, PLATFORM_2
    	add $t0, $gp, $s0
    	li $t2, platformC1
   	li $t9, platformC2
    	li $t3, 20
    	jal plat_loop
    	li $s0, PLATFORM_3
    	add $t0, $gp, $s0
    	li $t2, platformC1
    	li $t9, platformC2
    	li $t3, 10
    	jal plat_loop
    	li $s0, PLATFORM_4
    	add $t0, $gp, $s0
    	li $t2, platformC1
    	li $t9, platformC2
    	li $t3, 24
    	jal plat_loop
     	li $s0, PLATFORM_5
    	add $t0, $gp, $s0
    	li $t2, platformC1
    	li $t9, platformC2
   	li $t3, 12
    	jal plat_loop
      	li $s0, PLATFORM_6
    	add $t0, $gp, $s0
    	li $t2, platformC1
    	li $t9, platformC2
    	li $t3, 12
    	jal plat_loop
  
    	#moving enemies 
    	jal redraw_moving_fire
    	jal redraw_moving_fire_1
        #check collision and redraw health bar
    	jal check_collision
    	jal redraw_health_bar
    
    	# Sleep to delay animation
    	li $v0, 32
    	li $a0, 100
    	syscall
    
    
    	#always be falling if not on platform
    	j gravity
    
do_action:
    	lw $t5, 0xffff0004
    	beq $t5, 0x77, move_up  #if w is pressed, go up
    	beq $t5, 0x70, init #if p key pressed, reset
   	beq $t5, 0x73, gravity #if d is pressed, go down
    	beq $t5, 0x61, shift_left        # if a is pressed, go left
    	beq $t5, 0x64, shift_right        # if d is pressed, go right
    
    	j mainLoop           
	
gravity:
        lw $t5, BACKGROUND_COLOR_Array

    	add $t4, $gp, $s1
        add $t6, $gp, $s1
        #check if we are on a platform
    	lw $t4, 2320($t4) #2816
    	lw $t6, 2340($t6)
    	bne $t5, $t4, reset_jump
	bne $t5, $t6, reset_jump
        add $t0, $gp, $s1
	jal clear_ogre   #clear the ogres current lccation
    	addi $s1, $s1, 256            #move ogre down
 
    	jal redraw_ogre           # redraw the ogre in the new location

   
    	
    	j mainLoop          # go back to mainLoop

move_up:
        add $t0, $gp, $s1
	lw $t2, BACKGROUND_COLOR_Array
	#check if we can go up     
    	addi $t4, $s1, -256
    	blt $t4, 1024, mainLoop 
    	
    	#check if we can double jump
    	blez $k0, mainLoop
    	beq $k0, 1, doubleJump
    	addi $k0, $k0, -1
    	
    	
	jal clear_ogre #clear ogre in current position 
	
    	
   	addi $s1, $s1, -2048       # Move index up x rows
	addi $s1, $s1, -768
    	jal redraw_ogre           #redraw ogre at new index

   	

    	j mainLoop            # jump back to mainLoop

doubleJump:
	 add $t0, $gp, $s1
	lw $t2, BACKGROUND_COLOR_Array      
    	addi $t4, $s1, -256 
    	bltz $t4, mainLoop 
    	
    	addi $k0, $k0, -1 #reduce number of jumps
    	
    	
	jal clear_ogre
	
    	
   	addi $s1, $s1, -2048     

    	jal redraw_ogre          

   	

    	j mainLoop         
    
shift_left:
   
	add $t0, $gp, $s1
	lw $t2, BACKGROUND_COLOR_Array      
    	
    	#check if we can go left
    	addi $t4, $s1, -4
    	li $t5, 256
    	div $t4, $t5
    	mfhi $t5
    	beq $t5, 0, mainLoop
    	
	jal clear_ogre
	
	

        addi $s1, $s1, -16         
	#addi $s2, $s2, -16 
        #addi $s3, $s3, -16 
    	jal redraw_ogre          
   
    	j mainLoop            # jump back to mainLoop
    
shift_right:
    	add $t0, $gp, $s1
	lw $t2, BACKGROUND_COLOR_Array      
	#check if we can go right
	addi $t4, $s1, 16
    	li $t5, 256
    	div $t4, $t5
    	mfhi $t5
    	beq $t5, 212, mainLoop
    
	jal clear_ogre
	
	

        addi $s1, $s1, 16            
	#addi $s2, $s2, 16 
        #addi $s3, $s3, 16 
   	jal redraw_ogre           
    

    	j mainLoop       

